import React from "react";
import Fncomp from "./Components/Fncomp";
import ClsComp from "./Components/ClsComp";
import Click from"./Components/Click"
import Prop from "./Components/Prop"

function App() {
  return (
    <div>
          {/* Components --- Custom HTML Tags */}
      <Fncomp/>
      <ClsComp/>
      <Click/>
      <Prop name="John" />
      <Prop name="David" />
      <Prop name="Noel" />


    </div>
  );
}

export default App;
